  useEffect(() => {
    procesoCostoso();
    setOn(!on);
  }, [on]);

  const procesoCostoso = () => {
    console.log("proceso costo");
  };

  return (
    <div>
      <h1>Pagina de error</h1>

      <button onClick={() => setOn(!on)}>Cambiar estado</button>

      <br />

      {on ? "encendido" : "apagado"}
    </div>
  );
};
